import React from "react";
import Logo from "../Prepifi.png";
import { Input } from "postcss";

function Onboard() {
  return (
    <div className="flex flex-col items-center justify-center h-screen">
      <img src={Logo} alt="" />
      <div className="bg-white p-8 rounded shadow min-w-52">
        <h2 className="font-black mt-10">PERSONAL INFO</h2>
        <input
          type="text"
          placeholder="Full Name"
          className="mt-4 p-2 border w-[100%] border-gray-300 rounded"
        />
        <select className="mt-4 p-2 border w-[100%] border-gray-300 rounded">
          <option value="" disabled selected>
            Select Pronouns
          </option>
          <option value="he/him">He/Him</option>
          <option value="she/her">She/Her</option>
          <option value="they/them">They/Them</option>
          <option value="other">Other</option>
        </select>
      </div>
    </div>
  );
}

export default Onboard;
